import{_ as s}from"./Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.004-D-lAiJXD.js";import{_ as o}from"./Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.006-C6TVXSfy.js";import{_ as g}from"./Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.008-CELUo195.js";import{_ as r}from"./Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.010-DDUYNioq.js";import{_ as n}from"./Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.017-57kAEd1K.js";import{_ as p}from"./Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.019-CQSyaFwC.js";import{_ as i}from"./Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.021-QBaRAmgp.js";import{_ as a}from"./Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.023-C7RHCIAC.js";import{_ as l,a as e}from"./Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.028-Cpi_m1_R.js";import{_ as m}from"./Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.030-Cy6WJzwU.js";import{_ as c}from"./Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.033-D067HoDi.js";import{_ as B}from"./Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.035-CZPeNSOK.js";import{_ as v}from"./Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.038-BdANhsvJ.js";import{_ as d}from"./Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.043-D3kYqrSW.js";import{_ as U,a as b,b as O,c as V,d as Q,e as u,f as E}from"./Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.227-B6cnCt95.js";import{_ as I,c as N,a as D,o as X}from"./app-CUu1n7_5.js";const w="/parts-intellect-docs/assets/Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.409-B25We0dw.png",R="data:image/png;base64,",f="/parts-intellect-docs/assets/Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.411-9m40Hiem.png",t="data:image/png;base64,",W="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAA8AAAAPCAIAAAC0tAIdAAAABmJLR0QA/wD/AP+gvaeTAAAACXBIWXMAAA7EAAAOxAGVKw4bAAAAM0lEQVQokWP8//8/A9GAiXilI0r17NmzOzs7sTLQAAsDA8OFCxfevXuHlYEGGEdjBwMAAFGxIAtGIcBjAAAAAElFTkSuQmCC",z="data:image/png;base64,",K="data:image/png;base64,",C="data:image/png;base64,",J="data:image/png;base64,",k="/parts-intellect-docs/assets/Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.418-DXXfsbp5.png",P="data:image/png;base64,",h="/parts-intellect-docs/assets/Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.420-BQ6HKshz.png",y="data:image/png;base64,",S="/parts-intellect-docs/assets/Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.422-BLLHFr2Y.png",G="data:image/png;base64,",x="/parts-intellect-docs/assets/Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.424-D8zJo0WR.png",L="data:image/png;base64,",T="/parts-intellect-docs/assets/Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.426-CzHuUjfc.png",q="data:image/png;base64,",j="data:image/png;base64,",M="data:image/png;base64,",Z="data:image/png;base64,",F="data:image/png;base64,",H="data:image/png;base64,",Y="data:image/png;base64,",_="data:image/png;base64,",$="data:image/png;base64,",AA="data:image/png;base64,",tA="data:image/png;base64,",sA="data:image/png;base64,",oA="data:image/png;base64,",gA="data:image/png;base64,",rA="/parts-intellect-docs/assets/Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.441-DZlrZ_mJ.png",nA={};function pA(iA,A){return X(),N("div",null,A[0]||(A[0]=[D('<p>Инструмент <strong>Быстрая продажа</strong> предназначен для организации деятельности по продаже запчастей в розницу.</p><p>Все необходимые элементы расположены на одной форме, а при совершении продажи формируется требуемый набор документов, и печатается чек по нажатию кнопки <strong>Оформить</strong>.</p><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Окно инструмента <strong>Быстрая продажа</strong> можно выбрать как <strong>Интерфейс по умолчанию</strong> для пользователя, это значит, что при открытии базы данных пользователю будет доступно только окно <strong>Быстрой продажи</strong>. Настройка производится в меню <strong>Управление ► Настройки пользователя ►</strong> вкладка <strong>Основные</strong>.</p></div><p><img src="'+w+'" alt=""></p><p><img src="'+s+'" alt=""> <strong>Поле ввода</strong></p><p><img src="'+R+'" alt=""></p><p>Позволяет ввести штрихкод или артикул товара для осуществления поиска позиции.</p><p><img src="'+f+'" alt=""></p><p>В случае неоднозначности (по артикулу найдено несколько производителей и т.д.) отобразится список доступных товаров. Если запрошенный артикул не найден, выполняется подбор товара по его аналогам и/или веб-аналогам, в зависимости от установленного свойства в выпадающем списке команды <strong>Найти</strong>. Подбор осуществляется с учетом справочников <strong>Синонимы товаров</strong> и <strong>Синонимы производителей</strong>.</p><p><img src="'+t+'" alt=""></p><div class="hint-container info"><p class="hint-container-title">Примечание</p><p>Поиск в <strong>Быстрой продаже</strong> сначала идет по штрихкоду производителя, затем по внутреннему штрихкоду для товара, если по штрихкодам ничего не найдено, поиск идет по коду товара и внутреннему коду товара.</p></div><p>Команда <img src="'+W+'" alt=""> позволяет перейти в справочник <strong>Товары</strong> для выбора товара из справочника.</p><p>Команда <img src="'+z+'" alt=""> позволяет очистить поле поиска товара.</p><p><img src="'+o+'" alt=""> <strong>Найти</strong></p><p><img src="'+K+'" alt=""></p><p>Позволяет осуществить поиск товара в прайс-листах из наличия. Учитывается только свободный для продажи товар (исключаются позиции в резерве под каких-либо клиентов).</p><p>Выпадающий список команды позволяет установить источник подбора товара, в случае, когда товар не был найден по определенному артикулу.</p><p><img src="'+t+'" alt=""></p><p>Доступные значения:</p><ul><li><strong>Искать в аналогах</strong> – позволяет активировать поиск товара в справочнике <strong>Аналоги</strong>;</li></ul><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Если опция <strong>Искать в аналогах</strong> включена, то при выборе товара добавляется список аналогов выбранного товара на вкладке <strong>Аналоги в наличии</strong>.</p></div><ul><li><strong>Искать в веб-аналогах</strong> – позволяет активировать поиск товара в сервисе <strong>Веб-аналоги</strong> (при активной подписке).</li></ul><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Результаты по веб-аналогам отображаются вместе с результатами поиска из наличия. Аналоги из веб-аналогов не отображаются на вкладке <strong>Аналоги в наличии</strong>, если их нет в наличии.</p></div><div class="hint-container info"><p class="hint-container-title">Примечание</p><p>Данные свойства так же можно установить в разделе <strong>Управление ► Настройки пользователя</strong> на вкладке <strong>Быстрая продажа</strong>.</p></div><p><img src="'+g+'" alt=""> <strong>Удалить позицию</strong></p><p><img src="'+C+'" alt=""></p><p>Позволяет удалить позицию из списка выбранных.</p><p><img src="'+r+'" alt=""> <strong>Наценка/Скидка</strong></p><p><img src="'+J+'" alt=""></p><p>Позволяет установить наценку, либо скидку на выделенные позиции.</p><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Изменение цены с помощью команды <strong>Наценка/Скидка</strong> может быть не доступно пользователю, при отключенной настройке <strong>Отображать команду</strong> &quot;<strong>Наценка/Скидка</strong>&quot; в меню <strong>Управление</strong> <strong>► Настройки пользователя</strong>, вкладка <strong>Быстрая продажа</strong>.</p></div><p><img src="'+k+'" alt=""></p><p>Форма содержит следующие поля:</p><ul><li><p><strong>Изменить</strong> – позволяет выбрать какую цену изменить <strong>Цену продажи</strong> или <strong>Цену закупа</strong>;</p></li><li><p><strong>Относительно</strong> – позволяет выбрать относительно какой цены изменить <strong>Цену продажи</strong>/<strong>Цену закупа</strong>;</p></li><li><p><strong>Применить для</strong> – позволяет выбрать для каких товаров применить правило изменения цены. Возможны два состояния команды: <strong>Выделенных позиций</strong> и <strong>Всех позиций</strong>.</p></li><li><p><strong>Использовать фиксированное значение</strong> – позволяет задать фиксированную наценку/скидку для выбранных товаров. Опцию <strong>Наценка, %</strong> можно сменить на опцию <strong>Скидка, %</strong> нажатием по ней левой кнопкой мыши.</p></li><li><p><strong>Использовать стандартную наценку из карточки товара</strong> – при активной настройке цены выбранных товаров изменяются относительно значений, указанных в карточке товара, в поле <strong>Стандартная наценка, %</strong>.</p></li><li><p><strong>Применить правила округления валюты</strong> – при включенной настройке применяются правила округления валюты, указанные в разделе <strong>Финансы</strong> ► <strong>Валюты и курсы</strong>, в инспекторе редактирования валюты, на вкладке <strong>Округление цены</strong>.</p></li></ul><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Программа &quot;запоминает&quot; заданные параметры и при последующем вызове команды будут предложены последние настройки.</p></div><p><img src="'+n+'" alt=""> <strong>Отменить заказ</strong></p><p><img src="'+P+'" alt=""></p><p>Позволяет очистить список позиций и сбросить все опции.</p><p><img src="'+p+'" alt=""> <strong>Табличная часть</strong></p><p><img src="'+h+'" alt=""></p><p>Содержит подобранные позиции товаров. Допускается редактирование количества товара и его цены (при наличии дополнительных разрешений на редактирование).</p><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Возможность редактирования <strong>Цены закупа</strong> и <strong>Цены продажи</strong> определяется настройками <strong>Можно изменять цену закупа в Быстрой продаже</strong> и <strong>Можно изменять цену продажи в Быстрой продаже</strong> раздела <strong>Управление ► Настройки программы ► Роли пользователей</strong> в группе <strong>Документы ► Расходные накладные</strong>.При добавлении в табличную часть товаров с одинаковыми значениями: <strong>Артикул</strong>, <strong>Производитель</strong>, <strong>Склад</strong>, <strong>Цена продажи</strong> и <strong>Цена закупа</strong> производится объединение позиций с увеличением их количества.</p></div><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Список, порядок и отображение столбцов в <strong>Табличной части</strong> настраивается индивидуально каждым пользователем программы.Для отображения/скрытия колонок используется команда <strong>Выбор колонок</strong>, которая открывает одноименное окно.</p></div><p>Доступные колонки по позициям в табличной части:</p><ul><li><p><strong>Альтернативное название</strong> – <strong>Альт. наименование</strong> указанное в карточке товара;</p></li><li><p><strong>Артикул</strong> – код товара;</p></li><li><p><strong>Вес товара</strong> – вес товара из карточки товара;</p></li><li><p><strong>Внутренний резерв</strong> – отображает время до окончания <strong>Внутреннего резерва</strong> по позиции;</p></li></ul><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Механизм внутреннего резервирования отвечает за блокировку выбора одного и того же товара разными менеджерами. Настроить механизм можно в разделе <strong>Управление ► Настройки программы ► Настройки ►</strong> группа <strong>Склад и закупки ► Движение товара</strong> в группе <strong>Внутреннее резервирование товара</strong>.</p></div><ul><li><p><strong>Группа товара</strong> – группа товара из справочника <strong>Товары</strong>;</p></li><li><p><strong>Изображение</strong> – отображает признак, загружено ли у товара изображение. Если изображение загружено в карточке товара, то отображается иконка <img src="'+y+'" alt="">. При двойном нажатии на иконку открывается вкладка с изображениями товара;</p></li><li><p><strong>Код ТНВЭД</strong> – <strong>Код ТНВЭД</strong> указанный в карточке товара;</p></li><li><p><strong>Кол-во</strong> – количество продаваемого товара;</p></li></ul><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Количество товара подсвечивается желтым, если оно не соответствует кратности в колонке Кратность наличия.<img src="'+S+'" alt=""></p></div><ul><li><p><strong>Кратность наличия</strong> – коэффициент, согласно которому может быть выбрано количество для заказа из наличия. Также выполняет роль минимального количества к заказу;</p></li><li><p><strong>Наименование</strong> – наименование товара из карточки товара;</p></li><li><p><strong>Наценка, %</strong> – наценка на товары в отношении закупочной цены к цене продажи по документу;</p></li></ul><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Значение наценки автоматически подстраивается под выбранного клиента (под его категорию). Вы можете изменить наценку с помощью команды <strong>Наценка/Скидка</strong>.</p></div><ul><li><strong>Не соответствует кратности наличия</strong> – отметка о несоответствии кратности из наличия товара;</li></ul><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Если количество товара кратно кратности наличия, то галочка в колонке <strong>Не соответствует кратности наличия</strong> отсутствует.Если количество товара НЕ кратно кратности наличия, то галочка – отображается.</p></div><ul><li><p><strong>Описание товара</strong> – описание товара из карточки товара;</p></li><li><p><strong>Производитель</strong> – производитель товара;</p></li><li><p><strong>Склад</strong> – склад, на котором находится товар;</p></li><li><p><strong>Сумма</strong> – итоговая сумма товара исходя из произведения количества и цены продажи;</p></li><li><p><strong>Цена закупа</strong> – закупочная цена на товар с учетом маркетинга;</p></li><li><p><strong>Цена продажи</strong> – цена на товар с учетом маркетинга.</p></li></ul><p><img src="'+i+'" alt=""> <strong>Места хранения</strong></p><p><img src="'+G+'" alt=""></p><p>Отображает все места хранения и количество товара на них для выделенного в списке товара (учитываются только доступные для пользователя склады).</p><p><img src="'+x+'" alt=""></p><p>Доступные колонки по позициям в табличной части:</p><ul><li><p><strong>Склад</strong> – отображает склад/торговую точку, на котором(-ой) хранится товар;</p></li><li><p><strong>Идентификатор места хранения</strong> – отображает идентификатор склада/торговой точки из справочника <strong>Склады/Торговые точки</strong>;</p></li><li><p><strong>Остаток</strong> – количественный остаток товара на месте хранения.</p></li></ul><p><img src="'+a+'" alt=""> <strong>Аналоги в наличии</strong></p><p><img src="'+L+'" alt=""></p><p>Отображает имеющиеся в наличии аналоги для выделенной позиции.</p><p><img src="'+T+'" alt=""></p><p>Вкладка содержит следующие кнопки:</p><ul><li><p><strong>Заменить на</strong> – выделенная позиция заменяется на выбранный аналог;</p></li><li><p><strong>Добавить</strong> – добавится аналог товара в список позиций для продажи.</p></li></ul><p>Доступные колонки по позициям в табличной части:</p><ul><li><p><strong>Артикул</strong> – код детали-аналога;</p></li><li><p><strong>Производитель</strong> – производитель детали-аналога;</p></li><li><p><strong>Наименование</strong> – наименование детали-аналога;</p></li><li><p><strong>Склад</strong> – склад, на котором хранится товар;</p></li><li><p><strong>Цена</strong> – цена товара;</p></li><li><p><strong>Остаток</strong> – остаток товара на складах;</p></li><li><p><strong>Изображение</strong> – изображение товара;</p></li><li><p><strong>Кратность наличия</strong> – коэффициент, согласно которому может быть выбрано количество для заказа из наличия. Также выполняет роль минимального количества к заказу.</p></li></ul><p><img src="'+l+'" alt=""> <strong>Клиент</strong></p><p><img src="'+q+'" alt=""></p><p>Позволяет указать клиента, для которого совершается продажа.</p><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Поле может быть заполнено по умолчанию значением из настройки <strong>Контрагент по умолчанию</strong> для документа <strong>Расходная накладная</strong> в разделе <strong>Управление ► Настройки программы ► Роли пользователей ► Разрешения для роли пользователей ►</strong> группа <strong>Документы</strong>.</p></div><p><img src="'+e+'" alt=""> <strong>Категория клиента</strong></p><p><img src="'+j+'" alt=""></p><p>Отображается текущая категория клиента. Если выбран клиент, то поле категория заполняется автоматически.</p><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Возможность изменения категории определяется разрешением <strong>Можно изменять категорию клиента</strong> в разделе <strong>Управление ► Настройки программы ► Роли пользователей ► Разрешения для роли пользователей ►</strong> группа <strong>Документы ► Расходные накладные</strong> ► блок <strong>Быстрая продажа</strong>.</p></div><p><img src="'+m+'" alt=""> <strong>Валюта документа</strong></p><p><img src="'+M+'" alt=""></p><p>Отображается валюта, в которой выводятся цены и сумма по продаже.</p><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Настройка <strong>Выбирать валюту контрагента в документах и в проценке</strong> раздела <strong>Управление</strong> ►<strong>Настройки программы</strong> ►<strong>Настройки</strong> группы <strong>Документы</strong> не заменяет валюту в <strong>Быстрой продаже</strong>, валютой установленной в карточке контрагента.</p></div><p><img src="'+c+'" alt=""> <strong>Скидка</strong></p><p><img src="'+Z+'" alt=""></p><p>Позволяет указать скидку по документу в процентном соотношений или в сумме, при выборе соответствующего варианта. Доступна возможность указать значение скидки:</p><ul><li><p><strong>Процент</strong> – скидка в процентах от общей стоимости товаров, максимальное значение 100%;</p></li><li><p><strong>Сумма</strong> – скидка в денежном значении, максимальное значение - общая сумма всех позиций табличной части.</p></li></ul><p><img src="'+B+'" alt=""> <strong>UDS</strong></p><p><img src="'+F+'" alt=""></p><p>Позволяет воспользоваться функционалом сервиса <strong>UDS</strong> по начислению/списанию баллов клиента, предоставлению скидки в момент продажи товара клиенту.</p><div class="hint-container info"><p class="hint-container-title">Примечание</p><p>Доступность данной функции определяется состоянием подписки и наличием подключенной услуги. Условия подключения можно узнать у наших менеджеров (контактные данные можно найти по адресу <a href="http://www.tradesoft.ru/about/contacts/" target="_blank" rel="noopener noreferrer">www.tradesoft.ru/about/contacts</a>).</p><p>Подробнее о работе с сервисом <strong>UDS</strong> читайте в <a href="https://product-doc.tradesoft.ru/ai/uds/index.htm" target="_blank" rel="noopener noreferrer">руководстве пользователя</a>.</p></div><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>При использовании скидки, в панели оформления продаж блокируется поле <strong>Скидка (F7)</strong>.</p></div><div class="hint-container warning"><p class="hint-container-title">Внимание!</p><p>При назначении штрафов не рекомендуется использование сервиса <strong>UDS</strong>.Способ начисления и размер штрафа определяется настройками <strong>Способ начисления штрафа</strong> и <strong>Размер штрафа за наличие просроченной задолженности или выхода за лимиты балансов, %</strong> в разделе <strong>Управление ► Настройки программы ► Настройки</strong>, блок <strong>CRM ► <a href="#c1e2ff4d-f547-457b-938c-40312ac65ee5">Контрагенты**</a></strong>.</p></div><p><img src="'+v+'" alt=""> <strong>Тип оплаты</strong></p><p><img src="'+H+'" alt=""></p><p>Позволяет указать способ оплаты товаров клиентом. Если выбран способ <strong>Без оплаты</strong>, то при оформлении продажи не будет оформляться какая-либо оплата.</p><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Список доступных способов задается в меню <strong>Управление ►</strong> <strong>Настройки программы ► Роли пользователей ► Разрешения для роли пользователей ►</strong> группа <strong>Документы ► Расходные накладные ►</strong> блок <strong>Быстрая продажа</strong>, опция <strong>Доступные типы оплат</strong>.</p></div><p><img src="'+d+'" alt=""> <strong>Получено от покупателя</strong></p><p><img src="'+Y+'" alt=""></p><p>Позволяет ввести сумму наличных и/или банковской, полученных от клиента.</p><p>Отображение полей <strong>Наличными</strong> и <strong>Картой</strong> зависит от выбранного типа оплаты. При выборе типа оплаты:</p><ul><li><p><strong>Наличными</strong> – отображается поле для ввода <strong>Наличными</strong> со значением итоговой стоимости всех товаров табличной части;</p></li><li><p><strong>Картой</strong> – отображается поле для ввода <strong>Картой</strong> со значением итоговой стоимости всех товаров табличной части. Значение не доступно к редактированию и автоматически актуализируется при изменении цен продажи товаров;</p></li><li><p><strong>Смешанная</strong> – отображаются поля для ввода <strong>Наличными</strong> и <strong>Картой</strong>;</p></li><li><p><strong>Без оплаты</strong> – не отображает полей для ввода.</p></li></ul><p><img src="'+U+'" alt=""> <strong>Комментарий к документу</strong></p><p><img src="'+_+'" alt=""></p><p>Позволяет ввести комментарий к документу <strong>Расходная накладная</strong>, который будет создан после оформления продажи. Поле по умолчанию свернуто.</p><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Отображение поля <strong>Комментарий к документу</strong> регулируется настройкой <strong>Отображать поле Комментарий к документу</strong> раздела <strong>Управление ► Настройки пользователя</strong> на вкладке <strong>Быстрая продажа</strong>.</p></div><p><img src="'+b+'" alt=""> <strong>Без скидки</strong></p><p><img src="'+$+'" alt=""></p><p>Отображается сумма по документу без учета скидки.</p><p><img src="'+O+'" alt=""> <strong>Скидка</strong></p><p><img src="'+AA+'" alt=""></p><p>Отображает примененную скидку к позициям товаров.</p><p><img src="'+V+'" alt=""> <strong>Итого</strong></p><p><img src="'+tA+'" alt=""></p><p>Отображает итоговую стоимость покупок с учетом скидки.</p><p><img src="'+Q+'" alt=""> <strong>Сдача</strong></p><p><img src="'+sA+'" alt=""></p><p>Отображает сумму сдачи, которую требуется выдать клиенту. Разница между полученной от клиента суммы и итоговой стоимости покупок.</p><p><img src="'+u+'" alt=""> <strong>Оформить</strong></p><p><img src="'+oA+'" alt=""></p><p>Позволяет сформировать документ <strong>Расходная накладная</strong> на основе продажи. По умолчанию оформление означает:</p><ul><li><p>для указанного клиента и списка позиций создается новый документ <strong>Расходная накладная</strong>;</p></li><li><p>новый документ <strong>Расходная накладная</strong> проводится;</p></li><li><p>на его основании создается <strong>Приходный кассовый ордер</strong> или <strong>Оплата по банковской карте</strong> (в зависимости от способа оплаты) и печатает чек (если это указано в <strong>Настройках пользователя</strong>);</p></li></ul><div class="hint-container warning"><p class="hint-container-title">Внимание!</p><p>В случае возникновения ошибок проводки/создания платежных документов, <strong>Расходная накладная</strong> и связанные с ней платежи созданы не будут.</p></div><p><img src="'+gA+'" alt=""></p><p>Из раскрывающегося списка команды <strong>Оформить (Ctrl+Enter)</strong> можно выбрать другое действие:</p><ul><li><p><strong>Сохранить</strong> – на основании информации из быстрой продажи будет создан и сохранен документ <strong>Расходная накладная</strong>. При этом факт оплаты будет игнорироваться.</p></li><li><p><strong>Сохранить</strong> <strong>и напечатать</strong> – на основании информации из быстрой продажи будет создан и сохранен документ <strong>Расходная накладная</strong>. При этом факт оплаты будет игнорироваться. И для сохраненного документа будет вызван мастер печати.</p></li></ul><div class="hint-container info"><p class="hint-container-title">Примечание</p><p>Если используется скидка <strong>UDS</strong>, в документе фиксируется информация о примененной скидке, для списания баллов клиента необходимо провести документ.</p></div><ul><li><p><strong>Провести и оплатить</strong> – проводится и оплачивается <strong>Расходная накладная</strong>. В документе <strong>Расходная накладная</strong> фиксируется информация о примененной скидке;</p></li><li><p><strong>Провести, оплатить и напечатать</strong> – к предыдущему варианту добавляется то, что будет открыт мастер печати для созданной <strong>Расходной накладной</strong>.</p></li></ul><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Действия по умолчанию, которое выполняется программой при нажатии на команду <strong>Оформить</strong>, можно изменить в меню <strong>Управление ► Настройки пользователя ►</strong> вкладка <strong>Быстрая продажа</strong>.</p></div><p><img src="'+E+'" alt=""> <strong>История продаж</strong></p><p><img src="'+rA+'" alt=""></p><p>Отображаются последние 25 документов <strong>Расходная накладная</strong>, в соответствии с разрешениями пользователя (только свои, своих подразделений, все). По клику на номер можно открыть документ на редактирование, печать и т.д.</p><p>Доступные колонки по позициям в табличной части:</p><ul><li><p><strong>Дата</strong> – дата и время указанные в документе <strong>Расходная накладная</strong>;</p></li><li><p><strong>Номер</strong> – номер документа, является ссылкой для открытия документа;</p></li><li><p><strong>Клиент</strong> – клиент по документу <strong>Расходная накладная</strong>;</p></li><li><p><strong>Сумма итого</strong> – итоговая сумма по документу.</p></li></ul>',130)]))}const NA=I(nA,[["render",pA]]),DA=JSON.parse('{"path":"/specification/prodazhi/bystraja_prodazha.html","title":"Быстрая продажа","lang":"en-US","frontmatter":{"title":"Быстрая продажа","createTime":"2025/04/22 21:38:39"},"headers":[],"readingTime":{"minutes":7.07,"words":2121},"git":{"updatedTime":1745415005000,"contributors":[{"name":"a.lutoshkin","username":"","email":"a.lutoshkin@tradesoft.ru","commits":1,"avatar":"https://gravatar.com/avatar/605ee9d365e3a6380f8e9c71f9269ee5373d537aebefbece4e023cac396dfc8d?d=retro"}]},"filePathRelative":"specification/prodazhi/bystraja_prodazha.md","categoryList":[{"id":"fd8b54","sort":10022,"name":"specification"},{"id":"951041","sort":10039,"name":"prodazhi"}]}');export{NA as comp,DA as data};
